package tongo

import (
	"bytes"
	"encoding/hex"
	"github.com/startfellows/tongo/boc"
	"github.com/startfellows/tongo/tlb"
	"testing"
)

func TestTransaction(t *testing.T) {
	raws := []string{
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
	}
	for _, raw := range raws {
		data, _ := hex.DecodeString(raw)
		cells, _ := boc.DeserializeBoc(data)
		c := cells[0]
		var res Transaction
		err := tlb.Unmarshal(c, &res)
		if err != nil {
			t.Fatalf("error: %v", err)
		}
	}
}

func TestHash(t *testing.T) {
	// Lite client txs response
	// Account: -1:57E8E6D7A23A546736B73624B64E7449E0A47B95EAFC70E8CC441B7FB30CB842 Lt: 29067432000001 Hash: 8CFEA4730799269C9197B10E8F3DFEA7E151E31D0D1C9C1FB6D22910EFDEA447
	x := ""
	hash, _ := hex.DecodeString("8CFEA4730799269C9197B10E8F3DFEA7E151E31D0D1C9C1FB6D22910EFDEA447")
	b, _ := hex.DecodeString(x)
	cells, _ := boc.DeserializeBoc(b)
	h, _ := cells[0].Hash()
	if !bytes.Equal(hash, h) {
		t.Fatalf("Hash mismatch.\nOriginal:   %x\nCalculated: %x", hash, h)
	}
}
